"title": "1960 Elvis Presley Original Movie Still - Flaming Star 8x10&#39; B&W Publicity Lobby Photo Dolores Del Rio #81 Kiowa Indian Village Western Film",
"description": "A rare 1960 original movie still from &quot;Flaming Star&quot;! Elvis with attitude watching Dolores Del Rio & a Kiowa Indian woman. Photo #81. These photos are beautifully printed, sharp images that cannot be reproduced in MY photos! Please note that these are original, studio issued photos, not reprints. \n\nAfter his first 5 movies, Elvis wanted to play a serious dramatic role. This was it. It is generally considered to be one of his 2 best films (the other being King Creole). The New York Times film critic called it &quot;an unpretentious, sturdy Western that takes the time period, the place, & the people seriously. It&#39;s a neat & satisfying adventure.&quot; \n\nThe movie was directed by Don Siegel, written by Clair Huffaker & Nunnally Johnson, & costarred the lovely Dolores Del Rio, Barbara Eden, John McIntire, & Steve Forrest. Originally, Marlon Brando & Frank Sinatra were signed to play the roles of the brothers.\n\nPublicity stills of Elvis from this movie were used by Andy Warhol to create several iconic silkscreens. A copy of his &quot;Double Elvis&quot; sold for $37 million in 2013, & a &quot;Triple Elvis&quot; sold for $82 million last year.\n\nDESCRIPTION & CONDITION:\nThis publicity still measures 8 x 10&quot;. Its condition is Very Good to Fine with only very minor issues typical of photos of this age & that do not distract. There is a tiny tear (less than 1/4&quot;) & crease at the top left corner in the margin & a few pinholes in the margins. It has only a few creases & ripples, much less than normal for a photo this age. Please see all photos with zoom.\n\nIf you would like to see more photos, please convo.\n\nVisit my shop for more great Elvis collectibles:\nhttps://www.etsy.com/shop/vintagewordandimage/search?search_query=elvis\n\nPacked with care: sealed in an acid-free archival poly bag, sandwiched between cardboard sheets & shipped in a cardboard mailer by USPS Priority Mail, including tracking & insurance. Each extra movie still or art print ships FREE, so browse around my shop! Www.etsy.com/shop/vintagewordandimage\n\nInternational buyers please inquire if your country isn&#39;t listed in the shipping details. \n\nFor 100&#39;s of great antique & vintage art prints from around the world: www.etsy.com/shop/exoticimages\n\nThank you for stopping by! Please mark my shop as a Favorite & visit often as I continue to list great vintage books, magazines, art prints & movie memorabilia!",
