"title": "Handcrafted art pendants",
"announcement": "Welcome to The Pendant Emporium, an eclectic collection of pendants, necklaces and key chains, handcrafted in a smoke-free environment in our woodland cabin in the scenic Ozarks.\r\n\r\nTurnaround time for orders usually runs 3 to 4 days, weekends and postal holidays excluded.  If you have a deadline rapidly approaching, please contact us and we&#39;ll do our best to expedite your order at no extra charge.  Expedited orders are usually shipped next day via 1st Class, and if you need Priority Mail, we have a Priority Mail upgrade for $3 listed in the shop:\r\n\r\nhttps://www.etsy.com/listing/164463451/priority-mail-shipping-upgrade\r\n\r\nFor Priority, just click on the above and add it to your cart along with the rest of your items.  \r\n\r\nWe will email with tracking info when your order ships.   If you have any questions or concerns about your purchase, PLEASE contact us here in Etsy rather than sending to our overcrowded e-mail inbox where messages are sometimes overlooked (and often dumped into our junk mail folder by over-zealous filters). \r\n\r\nE-CHECKS -- Please note that paying by e-check will delay shipment of your order, since these take 3 to 7 days to process.\r\n\r\nGIFT BAGS:  Each necklace or key chain is packaged in its own little gauze gift bag.  If ordering pendants only, we place 2 or 3 pendants in each bag, but if you need a certain number we&#39;re always happy to provide more, just let us know in the &quot;Note from Buyer&quot; section at checkout or contact us here in Etsy.  \r\n\r\nINTERNATIONAL VISITORS -- We are not responsible for import and VAT taxes, so please check with your local Customs office before ordering to see if taxes may be due on your package.\r\n\r\nCUSTOM ORDERS are available for $3 more and we always send a picture of your proposed design before you make your purchase.  Please contact us for more info if interested in a custom piece.\r\n\r\nLOOKING FOR A SPECIFIC MAP? Click on the VINTAGE MAP section over to the left and browse, or use the search bar located just above the first row of pendants.  Type in your state or country and you&#39;ll bring up every city or national park for that area currently in our shop.\r\n\r\nThanks for visiting, and please don&#39;t hesitate to contact us here in Etsy if you have any questions.\r\n\r\nSherry & Dan\r\n\r\n",
