"policy_refunds": "We sincerely want each and every customer to be completely happy with their purchase.  Please contact us if there is any damage to your pendant in shipping or if you are unhappy with it in any way to arrange for a replacement or refund.  \r\n\r\nWe do our best to represent colors as they actually appear on the pendant, but monitors can differ somewhat in their color presentation.  If it&#39;s not what you were expecting, we are happy to arrange for a refund or exchange.\r\n",
