"title": "Your source for vintage vinyl on Etsy",
"announcement": "+++ SHOP VACATION NOTICE: Orders placed after 5/1/15 will ship 5/21/15. +++\r\n\r\nWelcome to DropTheNeedle.etsy.com! Thanks for stopping in to check out the shop. New items are added regularly, so check back often.\r\n\r\nHere you&#39;ll find a variety of vintage vinyl records, books and more. I&#39;ve been an avid record collector and music enthusiast for more than 35 years. Have a look around and feel free to contact me with any questions.\r\n\r\nSee my shop policies at: http://www.etsy.com/shop_policy.php?user_id=9907333\r\n\r\nNOTE: Sales tax is collected at the applicable rate for all items shipped to California addresses.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order!\r\n\r\n+++ SHOP VACATION NOTICE: Orders placed after 5/1/15 will ship 5/21/15. +++\r\nPer my shop announcement, orders placed after 5/1/15 will ship out on 5/21/15.  If you need your order shipped sooner and would like to cancel, simply send an email and I will process your order cancellation.\r\n\r\nWhen paying via PayPal, please ensure that your Etsy and PayPal addresses match, or leave a note to indicate where the order should be shipped.  This helps eliminate delay in processing your order.\r\n\r\nUpon receipt of payment, albums are shipped out within 3 business days via the US Postal Service (allow 7-10 business days for US delivery; international shipping delivery times vary by destination).  You will receive an email notification when your order has been mailed.\r\n\r\nShould you have any questions, feel free to contact me.\r\n\r\nThanks!\r\nMatt",
"digital_sale_message": null,
"last_updated_tsz": 1411772853,
"listing_active_count": 1052,
"login_name": "DropTheNeedle",
"accepts_custom_requests": false,
"policy_welcome": "Welcome! Thanks for checking out my shop.",
"policy_payment": "Payments are accepted via PayPal or Etsy Direct Checkout (credit card) and are due at the time you place your order.",
"policy_shipping": "All items are carefully packaged to reach you safely.\r\n\r\n*** NOTE: During the Christmas holiday season, the below shipping timing may not apply.  Refer to my shop banner for delivery date cutoffs or contact me to see what upgraded shipping options are available. ***\r\n\r\nShipments within the United States: Records and books are shipped via USPS Media Mail (Delivery time: 7-10 business days within the US) with Signature Confirmation required.  You will receive a shipment confirmation with tracking information when your order ships.  All other items ship USPS First Class.\r\n\r\n++ PLEASE NOTE ++  Beginning 1/27/13, the US Postal Service has increased postal shipping rates.  Unfortunately, these changes have affected international shipping rates dramatically.  Please review the new pricing before ordering.  You can read more about the postage increases on the Etsy blog here: http://www.etsy.com/blog/news/2013/shipping-rates-update-for-sellers/ \r\n\r\nInternational shipments: USPS First-Class Mail International (delivery time varies by destination, but generally allow a minimum of 2-3 weeks).  Please note that buyers are responsible for any and all duties and customs charges that may be incurred.\r\n\r\nNeed your shipment sooner?  Please contact me for additional shipping options.\r\n\r\nIMPORTANT:  Orders that are unable to be delivered and are returned to me can be re-shipped; however, the buyer is responsible for the additional shipping fees incurred to have the package delivered a second time.  Please use the tracking information provided to ensure you receive your package in a timely manner.  Feel free to contact me with any questions.",
"policy_refunds": "I want you to be satisfied with your purchase. Items are described as closely as possible; records are graded by industry standard. Please see the &quot;Additional Information&quot; section below for record grading descriptions and refer to these when making your record purchase(s). If you&#39;re dissatisfied with a purchase, please contact me.",
"policy_additional": "Vinyl Record Grading\r\n\r\n**Mint (M)\r\nAbsolutely perfect in every way. Certainly never been played, possibly even still sealed.\r\n\r\n**Near Mint (NM or M-)\r\nA nearly perfect record. The record should show no obvious signs of wear. A 45 RPM or EP sleeve should have no more than the most minor defects, such as almost invisible ring wear or other signs of slight handling. An LP cover should have no creases, cut-out holes, folds, seam splits or other noticeable similar defects. The same should be true of any other inserts, such as posters, lyric sleeves and the like.\r\nBasically, an LP in near mint condition looks as if you just got it home from a new record store and removed the shrink wrap.\r\n\r\n**Very Good Plus (VG+)\r\nA Very Good Plus record will show some signs that it was played and otherwise handled by a previous owner who took good care of it. Record surfaces may show some signs of wear and may have slight scuffs or very light scratches that don&#39;t affect one&#39;s listening experiences. Slight warps that do not affect the sound are &quot;OK&quot;.\r\nThe label may have some ring wear or discoloration, but it should be barely noticeable. The center hole will not have been misshapen by repeated play. Picture sleeves and LP inner sleeves will have some slight wear, lightly turned up corners, or a slight seam split. An LP cover may have slight signs of wear and may be marred by a cut-out hole, indentation or corner indicating it was taken out of print and sold at a discount.\r\nIn general, if not for a couple things wrong with it, this would be Near Mint. Most collectors find a Very Good Plus record highly acceptable.\r\n\r\n**Very Good (VG)\r\nMany of the defects found in a VG+ record will be more pronounced in a VG record. Surface noise will be evident upon playing, especially in soft passages and during a song&#39;s intro and fade, but will not overpower the music otherwise. Groove wear will start to be noticeable, as with light scratches (deep enough to feel with a fingernail) that will affect the sound.\r\nLabels may be marred by writing, or have tape or stickers (or their residue) attached. The same will be true of picture sleeves or LP covers. However, it will not have all of these problems at the same time, only two or three of them.\r\n\r\n**Good (G), Good Plus (G+)\r\nGood does not mean Bad! A record in Good or Good Plus condition can be put onto a turntable and will play through without skipping. But it will have significant surface noise and scratches and visible groove wear.\r\nA cover or sleeve will have seam splits, especially at the bottom or on the spine. Tape, writing, ring wear or other defects will start to overwhelm the object.\r\n\r\n**Poor (P), Fair (F)\r\n\r\nThe record is cracked, badly warped, and won&#39;t play through without skipping or repeating. The picture sleeve is water damaged, split on all three seams and heavily marred by wear and writing. The LP cover barely keeps the LP inside it. Inner sleeves are fully seam split, crinkled, and written upon.\r\nExcept for impossibly rare records otherwise unattainable, records in this condition will not be found in my shop.\r\n\r\nOther Considerations\r\n\r\nA separate grade is assigned to the record and it&#39;s sleeve or cover. In each listing, a record&#39;s grade is listed first, followed by that of the sleeve or the cover.",
