"announcement": "Welcome to my vintage shop on Etsy!  Relive your childhood-come on in and browse!  :) \r\n\r\nThis is my story:\r\nOur older home has fueled a passion for me to collect vintage items!  What started off as a hobby has turned into an outright passion!  I LOOOVE what I do! Every vintage item has a past - a story behind it - and that intrigues me.....all my shop items have stood the test of time!  :)  Vintage items are simply better quality and last longer than products made now.  My husband has gently encouraged me to share some of these vintage items with the world, :) - not to hoard them all,  :) - thus the birth of my shop!  :)  Plus, now I can work from home and enjoy the children that God has given me!  :)\r\n\r\nI take all photos on our vintage kitchen table.....I am not a professional photographer by any means, but I strive to do my best!   :-)  Photo taking has become a family affair......my girls help by arranging the items on our kitchen table.....and lately one daughter has even started to take some pictures!  :)\r\n\r\nI am finding great joy in uniting people with items they treasure from the past!  :)   Let me do the hunting for you!   :)  We support our local Goodwill and Salvation Army stores.....so when you buy from my shop, not only do you help our family, you help countless others by supporting these not for profit charity stores that help people get back on their feet again.  SO THANK YOU!!!!!!!!!!!!!!!!  :)\r\n\r\nIf you are looking for something specific, please feel free to contact me - I love being on the lookout for items.....adds to the thrill of the hunt!  And who knows, I actually may already have what you are looking for - just haven&#39;t got around to listing it yet!  It has happened!  :)\r\n\r\nPlease check me out on Pinterest - Kress Hill Vintage - I have many boards and you can see my personal growing Melmac collection (it does seem to be multiplying on its own!).  BTW, for you Melmac lovers, I have lots more Melmac to be listed.....plus I am growing very fond of vintage ads.....\r\n\r\nFor your information, we live in a non-smoking home.  If I purchase an item from an estate sale where there was a smoker, I will be sure to pass that information on to you in the listing.\r\n\r\nI have an eclectic style - you never know what you will find in my store!  I&#39;m always adding new items - (i have PLENTY to add!) - so please check back often!  I try to grow my shop every day!  :)\r\n\r\nThanks for stopping by!   :)\r\n\r\nQuestions?  Convo me for a quick reply!",
