"login_name": "kresshillvintage",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to Kress Hill Vintage Art & Collectibles!  :)\r\n\r\nLet&#39;s remember the past by surrounding ourselves with vintage items!  :)\r\n\r\nThank you for taking your valuable time to stop in my shop!  :)",
"policy_payment": "We accept PayPal, all major credit cards, money orders and Etsy gift cards.  I can also put items on layaway.  We are a registered business in the province of Ontario and thus must collect tax from our Canadian customers.  ",
"policy_shipping": "I ship worldwide - Canada Post in most cases (please convo if regular mail is fine or if you require insurance/tracking).  The rates quoted are estimates by regular mail only - insurance and tracking would likely be extra.  If you require faster delivery, please convo me. \r\n\r\nI am always thrilled to combine shipping costs - just convo me for a quote!  :)\r\n\r\nShipping costs are based on the weight of the item, packaging needs and destination.  I try to keep costs as low as possible.  It is very difficult to estimate shipping costs as they vary greatly from province to province, state to state and worldwide!  For final shipping costs, please contact me prior to making payment.  The shipping costs could indeed be well below the shipping estimates listed.  I do not make a profit on shipping, so if actual shipping costs are lower than estimated, I will refund the difference IMMEDIATELY.  Shipment is within 1-3 business days after payment has cleared.  In many instances I spend my time making boxes smaller to fit purchased items - to reduce your shipping costs as much as possible.   :)  I would rather you keep more money in your pocket than donate to Canada Post!  :)\r\n\r\nYour package will be sent to the address on your Etsy account - please ensure it is current!  Insurance is recommended on breakable items. \r\n\r\nINTERNATIONAL BUYERS - it is best to convo me for a shipping quote and state if you would like tracking and/or insurance. Taxes and fees for packages to enter buyer&#39;s country is the responsibility of the buyer.  Please be aware that it can take several weeks to receive your purchase, especially if sent by regular mail (ground).  For some countries, it can take as long as six to eight weeks!  You can request air mail, which would cost a little extra, then the estimated delivery time would be two-three weeks.  Expedited service, with tracking and insurance, is always an option, but please note it is very costly to send a parcel this way!\r\n\r\nI take great care packaging your items; however, I cannot control what happens to the package once it leaves my hands - so no refunds are given on damaged, lost or stolen packages.  If this is a concern, tracking and insurance  is recommended - advise you desire this when contacting for a shipping quote.  Your understanding is greatly appreciated.  :)\r\n\r\nI will notify you when your package has been shipped.\r\n\r\nAny questions - please convo!  :)",
"policy_refunds": "Customer satisfaction is the name of the game!  :) \r\n\r\nPlease keep in mind all items are gently used vintage items and in &quot;as is&quot; condition.  I take great care and do my heartfelt best to describe all items in detail.   I note any and all &quot;defects&quot; or &quot;faults&quot; as I see them.  I want my customers to purchase with full knowledge and confidence that what they are purchasing is EXACTLY what is pictured and described!  :-)\r\n\r\nI want you to be delighted with your purchase, but if you don&#39;t love it, I do accept returns.  Please contact me within 48 hours of receipt of your purchase.  A returned item should be in the same condition as when it left my hands (please carefully repackage!), and sent back in its original packaging, with all postage costs paid by the buyer.  \r\n\r\nI am pretty easy to get along with, really!  :-)\r\n\r\nBottom line - I want you to be happy!  :)  ",
