"policy_shipping": "I ship via USPS Media Mail using Delivery Confirmation.  I do my best to get to the post office daily.  My goal is to take your order to the post office within 24 hours of receiving payment.   If you need your item delivered overnight, convo me and I am sure that we can work it out. \r\n \r\nPlease contact me with any international shipping needs.  I will get a shipping quote and get back to you as soon as possible.  \r\n \r\nINTERNATIONAL CUSTOMERS ARE RESPONSIBLE FOR ALL CUSTOMS FEES. Please check with your postal service on the customs fees and procedures of your country.\r\n \r\n",
