"title": "nursery art prints, wedding art prints wedding and more",
"announcement": "AS SEEN IN HGTV Magazine! & now on theknot.com! | Shop art prints for nursery wedding & home, you are my sunshine art prints, wedding tree guest books, will you be my maid of honor prints, best friend photo quotes, interactive travel maps and more. PaperRamma&#39;s unique art is one of a kind & not found in stores. Our art is digitally crafted in our CT studio by our team of Design Gurus- just for you. \r\n\r\nI have the BEST clients: &quot;The pictures on line are awesome but when you physically receive the canvas you are just blown away! I couldn&#39;t be happier with my decision to work with Amanda. She must have given me about 7 or more proofs and gone back and forth with me over colors. She was a pleasure to work with and I HIGHLY recommend her to everyone! I can&#39;t wait to actually hang our wedding tree in our home!&quot;\r\n\r\nWelcome to PaperRamma! PaperRamma [pa&#39;per&#39;ram&#39;ma] n. 1. paper party 2. luxe designs, art prints and more that are one of a kind and not found in stores. 3. Hi I&#39;m Amanda, a sahm of 2 young boys and a little princess who always keeps me on my toes! :) everything you see in my shop is created by me & my team of Design Gurus :)",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "On maternity leave until September. I will be checking my convos, but If you have placed an order with me and have a question, please contact me via: designservices@socialcirclecards.com\r\n\r\nLook for new designs and specials posted when I get back :)\r\n\r\n~Amanda",
"sale_message": "UPDATE: 5/13 - 5/26: We are currently updating our Etsy store and streamlining our order process to make it even easier for our clients. While we make this transition, we appreciate your patience and understanding. We will continue to keep our clients updated if there are any changes to our timeline below*\r\n\r\nP R O O F S :\r\n: : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : :\r\nThank you for your order! Our order volume is currently: high. You can expect a proof in approximately 3-4 business days with regular processing (we are closed on the weekends and holidays). ***This estimate is based on current order volume and is not a guarantee***\r\n\r\n***We will be closed on TUE MAY 19 and MON MAY 25 (Memorial Day)\r\n\r\nFor orders not including rush, if you placed an order on:\r\nMON MAY 18:  You can expect a proof to be emailed to you on FRI MAY 22\r\nTUE MAY 19:  You can expect a proof to be emailed to you on FRI MAY 22\r\nWED MAY 20: You can expect a proof to be emailed to you on TUE MAY 26\r\nTHU MAY 21: You can expect a proof to be emailed to you on TUE MAY 26\r\nFRI MAY 22: You can expect a proof to be emailed to you on WED MAY 27\r\nSAT MAY 23: You can expect a proof to be emailed to you on WED MAY 27\r\nSUN MAY 24: You can expect a proof to be emailed to you on THU MAY 28\r\nMON MAY 25:  You can expect a proof to be emailed to you on THU MAY 28\r\nTUE MAY 26:  You can expect a proof to be emailed to you on FRI MAY 29\r\n\r\nAfter you&#39;ve submitted your customization and paid for your order, your proof will arrive shortly! We are not open on weekends- therefore all orders will be processed first thing Monday morning and proof will go out 3 business days from then. If no proof is required: i.e. clearly marked &quot;As Shown&quot; in the notes to seller, your order will ship out within 3-4 business days.\r\n\r\nC O N F I R M A T I O N ?\r\n: : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : :\r\nYou will not receive a confirmation of your order from me, just from etsy. Please be patient and wait for your proof to arrive. The less time I have to search for order statuses the more time I can spend getting proofs out to you :) Thank you for your help! If it has been more than 4 business days, please feel free to check in. ",
