"policy_welcome": "Hello. Welcome to my shop. My name is Amy and I am obsessed with everything vintage and search high and low to find items I think others may like as well. I have a passion for the hunt of those special treasures of the past. So whether you are looking for parachute pants, a record player, or a really cool salt shaker from the 70&#39;s, I may just have what you are looking for. My inventory is constantly changing so check back often. \r\nAmy ",
"policy_payment": "We accept credit cards through Etsy processing as our main form of payment. We will also accept PayPal. \r\nOrders paid through Etsy will show on your credit card bill as ETSY Brooklyn, NY \r\n",
"policy_shipping": "We ship within 2 days of receiving an order. We ship via UPS to USPS to offer you the most economical shipping method possible. When we ship an item you will receive a confirmation email with a tracking number. \r\n\r\nPLEASE NOTE: { We are NOT responsible for lost, stolen or undelivered packages } If you want to purchase insurance you may do so by contacting me prior to ordering. ALL LOST, STOLEN OR RETURNED packages paid without insurance are the responsibility of the buyer. USPS failures are not our fault or a reflection on our level of dedication to our customers.\r\n\r\n{INTERNATIONAL SHIPMENTS}\r\n International orders are averaging 5-12 business days for delivery. This depends on your country as well. { We cannot control customs delays and are not responsible for lost or stolen packages }. If you want to add insurance to your order please contact us prior to purchasing.\r\n",
"policy_refunds": "I strive to have satisfied customers so my goal is to provide good pictures and detailed descriptions of every item due to my items being vintage. If you do want to return an item, please contact me within 1 week of you receiving the item and we will work together to resolve issue in the form of a full refund or replacement item. \r\nI strive to provide you with the information you need before purchasing an item so please make sure to ask any questions you may have prior to purchasing so I can clarify. ",
